  input: '"TEXT","F3A","C00373001","This amends FEC-43072 and addresses questions
    raised in FEC letter of 9/24/02.  Excessive contributions disclosed on sch. A
    should have had memo entries indicating letters sent to request reattribution.  Reattributions
    will be shown on next report.  The $2,000 Diggs contribution was misreported,
    as the committee received two separate checks, one from Matt and one from Nancy
    for $1,000 each.  Emp/Occ information is updated in this amendment. Column B figures
    are correct, as previous reports have been amended.  Disbursements have been amended
    to show include missing addresses and purposes, to show FEC acceptable purposes
    and corrections made to reimbursements for travel expenses previously itemized.  48
    Hour notice filed shows Clay Mathile giving $2,000, with no memo entry to show
    reattribution request made.  Reattribution noted in this amendment."'
